import React from 'react';
import moment from 'moment';
import 'moment/locale/it';
import '../assets/css/navbar.css';
import Nav from './Nav';
import { Navbar as BootstrapNavbar, Nav as BootstrapNav, Button } from 'react-bootstrap';

const Navbar = () => {
  const currentDate = moment().locale('en').format('dddd, D MMMM YYYY');

  return (
    <BootstrapNavbar expand="lg">
      <div className="container-fluid">
        {/* Hamburger Menu Button */}
        <Button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </Button>

        {/* Logo al centro */}
        <div className="logo">
          <img
            src={require('../assets/images/thenewyorktimeslogo.png')}
            alt="New York Times Logo"
          />
        </div>

        {/* Contenuto del menu a sinistra */}
        <BootstrapNavbar.Collapse id="navbarToggleExternalContent">
          <BootstrapNav className="mr-auto">
            <BootstrapNav.Link href="#">Link 1</BootstrapNav.Link>
            <BootstrapNav.Link href="#">Link 2</BootstrapNav.Link>
            {/* Aggiungi altri link o componenti come necessario */}
          </BootstrapNav>
        </BootstrapNavbar.Collapse>

        {/* Sezione inferiore con data e linee divisorie */}
        <div className="bottom-section">
          <div className="current-date">
            {currentDate}
          </div>
          <hr className="divider" />
          <Nav />
          <hr className="divider" />
        </div>
      </div>
    </BootstrapNavbar>
  );
};

export default Navbar;
